css:
/* highlighting is the one intentional departure from gtk's styles */
.archive-editor {
  background-color: #292929;
  overflow: auto;
}
.archive-editor .archive-container {
  height: 100%;
  width: 100%;
}
.archive-editor .archive-container .inset-panel {
  border-width: 0;
}
.archive-editor .archive-container .inset-panel .panel-heading {
  border-radius: 0;
}
.archive-editor .archive-container .archive-tree {
  padding: 5px;
}
